MINHA OPINIÃO: 
EM ALGUNS DIAS,  IRÃO ANUNCIAR ALGUM PROBLEMA COM O LADRÃO E DIRÃO QUE ELE VEIO A ÓBITO (NA VERDADE ELE JÁ ESTÁ MORTO HÁ MAIS DE 1 MÊS),  DIPLOMARAM UM SÓSIA PRA LEGITIMAR A POSSE.  O PLANO, DESDE O COMEÇO ERA COLOCAR ALCKMIN NA PRESIDÊNCIA;
ISSO VAI CAUSAR UMA CONVULSÃO NA ESQUERDA E OS CRIMINOSOS VÃO DESCER OS MORROS, MST, ANTIFAS, CV, PCC E AGENTES ESTRANGEIROS VÃO CAUSAR O CAOS;
AS F.A. E O PR JÁ SABEM DISSO, PORÉM NÃO SABEM QUANDO VÃO ANUNCIAR A MORTE DO LARÁPIO, POR ISSO,  A DEMORA EM AGIR ESTÁ CONDICIONADA À MORTE DO MOLUSCO.
ESTAMOS NO AGUARDO!

